import Link from "next/link";

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div className="header">
    <div className="header-inner">

      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
      <Link href="/show">
        <a style={linkStyle}>Show</a>
      </Link>
      <Link href="/page">
        <a style={linkStyle}>page</a>
      </Link>
    </div>
  </div>
);

export default Header;
